import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom'
import './App.css';


import Navbar from './components/Navbar'
import Home from './components/screens/Home'

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Route exact path="/">
        <Home />
      </Route>
      <Route path= "/test_results">
        <Testesults />
      </Route>
        <Home />
      <Route>
        <Home />
      </Route>
    </BrowserRouter>

  );
}

export default App;
